import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  render() {
    const food = ['cycla', 'spring', 'hoppa'];
    return (
      <div className="App">
        <RandomSection source={food} type="food"/>
        <RandomSection source={food} type="phys"/>
        <RandomSection source={food} type="random"/>
      </div>
    );
  }
}

class RandomSection extends React.Component {
  render() {
    const source = this.props.source;
    const rand = Math.random() * source.length;
    const index = Math.floor(rand);
    return (
      <div> 
        <h2>Daily {this.props.type}</h2>
        <p>You should do this: {source[index]}</p>
        <LoadingButton/>
      </div>
    )
  }
}

export default App;
